import axios from "axios";

const userLogOut = (accessToken: string) => {
    return axios.post("https://desktop-app-production.up.railway.app/logout", {
        token: accessToken
    })
        .then((res) => {
            return res.data
        })
        .catch((err) => {
            return null;
        })
}

export default userLogOut;
